import React, { useState } from 'react';
import { motion } from 'framer-motion';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  CssBaseline,
  Box,
  Menu,
  MenuItem,
  Button,
  Badge,
  Dialog,
  DialogTitle,
  DialogContent,
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import NotificationsIcon from '@mui/icons-material/Notifications';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
  typography: {
    h6: {
      fontSize: '1.25rem',
      fontWeight: 700,
      color: '#fff',
    },
  },
});

// Animation variants for the menu icon
const menuIconVariants = {
  open: {
    rotate: 90,
    transition: {
      duration: 0.3,
    },
  },
  closed: {
    rotate: 0,
    transition: {
      duration: 0.3,
    },
  },
};

const notifications = [
  "New tournament added!",
  "Reminder: Football Championship starts tomorrow.",
  "Basketball Tournament registration is open.",
];

const Dashboard = () => {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const [notificationsOpen, setNotificationsOpen] = useState(false);
  const isMenuOpen = Boolean(anchorEl);
  const username = 'John Doe'; // Example username

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Implement logout functionality here
    handleMenuClose();
  };

  const handleNotificationsClick = () => {
    setNotificationsOpen(true);
  };

  const handleNotificationsClose = () => {
    setNotificationsOpen(false);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={() => setDrawerOpen(!drawerOpen)}>
            <motion.div
              variants={menuIconVariants}
              initial={drawerOpen ? 'open' : 'closed'}
              animate={drawerOpen ? 'open' : 'closed'}
            >
              <MenuIcon />
            </motion.div>
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Sports Tournament
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <IconButton edge="end" color="inherit" aria-label="notifications" onClick={handleNotificationsClick}>
              <Badge badgeContent={notifications.length} color="secondary">
                <NotificationsIcon />
              </Badge>
            </IconButton>
            <Button color="inherit" sx={{ ml: 2 }} variant="outlined">
              Advertise
            </Button>
            <IconButton edge="end" color="inherit" aria-label="profile" onClick={handleMenuOpen} sx={{ ml: 2 }}>
              <AccountCircleIcon />
            </IconButton>
            <Typography variant="body1" sx={{ ml: 2 }}>
              {username}
            </Typography>
          </Box>
          <Menu
            anchorEl={anchorEl}
            open={isMenuOpen}
            onClose={handleMenuClose}
            PaperProps={{
              sx: {
                backgroundColor: '#0A0A0A',
                color: '#fff',
              },
            }}
          >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My Account</MenuItem>
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        PaperProps={{
          sx: {
            backgroundColor: '#0A0A0A',
            color: '#fff',
          },
        }}
      >
        <List sx={{ width: 250 }}>
          <ListItem button onClick={() => setDrawerOpen(false)}>
            <ListItemIcon>
              <CloseIcon style={{ color: '#fff' }} />
            </ListItemIcon>
          </ListItem>
          <ListItem button component="a" href="/home">
            <ListItemText primary="Home" />
          </ListItem>
          <ListItem button component="a" href="/about-us">
            <ListItemText primary="About us" />
          </ListItem>
          <ListItem button component="a" href="/partner">
            <ListItemText primary="Partner With Us" />
          </ListItem>
          <ListItem button component="a" href="/membership-management">
            <ListItemText primary="Membership Management" />
          </ListItem>
          <ListItem button component="a" href="/book-now">
            <ListItemText primary="Book Now" />
          </ListItem>
          <ListItem button component="a" href="/news-events">
            <ListItemText primary="News and Events" />
          </ListItem>
          <ListItem button component="a" href="/careers">
            <ListItemText primary="Careers" />
          </ListItem>
          <ListItem button component="a" href="/blogs">
            <ListItemText primary="Blogs" />
          </ListItem>
        </List>
      </Drawer>

      <Dialog open={notificationsOpen} onClose={handleNotificationsClose}>
        <DialogTitle>Notifications</DialogTitle>
        <DialogContent>
          {notifications.length > 0 ? (
            <List>
              {notifications.map((notification, index) => (
                <ListItem key={index}>
                  <ListItemText primary={notification} />
                </ListItem>
              ))}
            </List>
          ) : (
            <Typography>No new notifications</Typography>
          )}
        </DialogContent>
      </Dialog>
    </ThemeProvider>
  );
};

export default Dashboard;
